/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function (s) {
  if(s === '') return 0;
  var str_array = s.split('');
  var str_array_length = str_array.length;
  var max_res = 1;
  for (var i = 0; i < str_array_length; i++) {
    var res = findStringFromArray(str_array, str_array_length, i);
    if (res){
      var res_length = res.length;
      max_res = max_res > res_length ? max_res : res_length;
      var skip_length = i + res_length;
      if(s.indexOf(res.join(''), skip_length) !== -1 && res_length > 3){
        i = skip_length;
      }
    }
  }
  return max_res;
};

function findStringFromArray(array, array_length, start) {
  var find_res = [];
  for (var j = start; j < array_length; j++) {
    if (find_res.indexOf(array[j]) === -1){
      find_res.push(array[j]);
    }else {
      return find_res;
    }
  }
  return find_res;
}

